apiVersion: v1
kind: Service
metadata:
  name: whisker
  namespace: calico-system
  ownerReferences:
  - apiVersion: operator.tigera.io/v1
    blockOwnerDeletion: true
    controller: true
    kind: Whisker
    name: default
  resourceVersion: "15257"
spec:
  clusterIP: 10.110.43.50
  clusterIPs:
  - 10.110.43.50
  internalTrafficPolicy: Cluster
  ipFamilies:
  - IPv4
  ipFamilyPolicy: SingleStack
  ports:
  - port: 8081
    protocol: TCP
    targetPort: 8081
  selector:
    k8s-app: whisker
  sessionAffinity: None
  type: ClusterIP
status:
  loadBalancer: {}
